function UTCDate(){return new Date(Date.UTC.apply(Date,arguments))}function format_date(a){var k=a.getUTCFullYear(),b=a.getUTCMonth()+1,g=a.getUTCDate(),f=a.getUTCHours(),e=a.getUTCMinutes(),n=a.getUTCSeconds(),c=a.getUTCMilliseconds();function j(d){return(d<=9?"0"+d:d)}return k+"-"+j(b)+"-"+j(g)+" "+j(f)+":"+j(e)+":"+j(n)+"."+j(c)}function datesEqual(c,b,a){QUnit.push(QUnit.equiv(c,b),format_date(c),format_date(b),a)};